import React from 'react'
import { Col, Row } from 'react-bootstrap';
import products from '../components/products';


const HomeScreen = () => {
    return (
        <>
            <h1>Latest products</h1>
            <Row>
                {products.map(product => (
                    <Col sm={12} md={6} lg={4}>
                        <product product={product}/>                    
                    </Col>
                ))}
            </Row>
        </>
    )
}

export default HomeScreen
